import React from 'react'
import { Link } from 'react-router-dom'

const Home = () => {
  return (
    <div>
      <nav>
        <Link to="/login">Login</Link>
          <Link to="/signup" >Signup</Link>
        </nav>
    </div>
  );
};

export default Home;
